export const setCustomerInfo = (payload) => ({
  type: SET_CUSTOMER_INFO,
  payload
})

export const setOrders = (payload) => ({
  type: SET_ORDERS,
  payload
})

export const startLoading = () => ({
  type: START_LOADING
})

export const stopLoading = () => ({
  type: STOP_LOADING
})
export const clearCustomer = () => ({
  type: CLEAR_CUSTOMER
})
